// --- ROBUST TOUCH HANDLING START ---
// This section implements a custom tap detection system to bypass
// potential click-blocking issues on iOS Safari/Opera.

let touchStartX = 0;
let touchStartY = 0;
let lastTouchTime = 0;

// 1. Capture Touch Start
document.addEventListener(
  "touchstart",
  (e) => {
    if (e.changedTouches && e.changedTouches.length > 0) {
      touchStartX = e.changedTouches[0].screenX;
      touchStartY = e.changedTouches[0].screenY;
    }
  },
  { passive: true }
);

// 2. Handle Touch End (The "Tap")
document.addEventListener("touchend", (e) => {
  if (e.changedTouches && e.changedTouches.length > 0) {
    const touchEndX = e.changedTouches[0].screenX;
    const touchEndY = e.changedTouches[0].screenY;

    // Calculate movement distance
    const diffX = Math.abs(touchEndX - touchStartX);
    const diffY = Math.abs(touchEndY - touchStartY);

    // If movement is small (< 10px), consider it a tap
    if (diffX < 10 && diffY < 10) {
      // Check if we tapped a target we care about
      const target = e.target;

      // A. Job Card Tap
      if (target.closest(".job-card")) {
        // Prevent default to stop ghost clicks if we handle it here
        // But be careful not to block scrolling if the user dragged (handled by diff check)
        // We use preventDefault to stop the browser from firing a delayed click
        if (e.cancelable) e.preventDefault();

        handleGlobalInteraction(e);
        lastTouchTime = Date.now();
        return;
      }

      // B. Custom Select Trigger Tap
      if (target.closest(".custom-select__trigger")) {
        if (e.cancelable) e.preventDefault();
        handleGlobalInteraction(e);
        lastTouchTime = Date.now();
        return;
      }

      // C. Custom Select Option Tap
      if (target.closest(".custom-option")) {
        if (e.cancelable) e.preventDefault();
        handleGlobalInteraction(e);
        lastTouchTime = Date.now();
        return;
      }

      // D. Close Buttons
      if (
        target.closest("#closeDetailsBtn") ||
        target.closest("#closeFiltersBtn") ||
        target.closest("#showFiltersBtn")
      ) {
        if (e.cancelable) e.preventDefault();
        handleGlobalInteraction(e);
        lastTouchTime = Date.now();
        return;
      }
    }
  }
});

// 3. Handle Standard Clicks
document.addEventListener("click", (e) => {
  // If a touch event was just handled (< 500ms ago), ignore this click
  // to prevent double-firing logic
  if (Date.now() - lastTouchTime < 500) return;

  handleGlobalInteraction(e);
});

// Unified Interaction Handler (called by both Click and TouchEnd)
const handleGlobalInteraction = (e) => {
  // 1. Show Filters Button
  const showFiltersBtn = e.target.closest("#showFiltersBtn");
  if (showFiltersBtn) {
    // e.preventDefault() might have been called already in touchend
    if (e.type === "click") e.preventDefault();

    const filtersModal = document.getElementById("filtersModal");
    if (filtersModal) {
      filtersModal.classList.add("filters--open");
      document.body.classList.add("no-scroll");
    }
    return;
  }

  // 2. Close Filters Button
  const closeFiltersBtn = e.target.closest("#closeFiltersBtn");
  if (closeFiltersBtn) {
    if (e.type === "click") e.preventDefault();
    const filtersModal = document.getElementById("filtersModal");
    if (filtersModal) {
      filtersModal.classList.remove("filters--open");
      document.body.classList.remove("no-scroll");
    }
    return;
  }

  // 3. Close Details Button
  const closeDetailsBtn = e.target.closest("#closeDetailsBtn");
  if (closeDetailsBtn) {
    if (e.type === "click") e.preventDefault();
    const detailsModal = document.getElementById("detailsModal");
    if (detailsModal) {
      detailsModal.classList.remove("details--open");
      document.body.classList.remove("no-scroll");
    }
    return;
  }

  // 4. Job Card Click
  const card = e.target.closest(".job-card");
  if (card) {
    const detailsModal = document.getElementById("detailsModal");
    if (detailsModal) {
      detailsModal.classList.add("details--open");
      document.body.classList.add("no-scroll");

      const jobId = card.dataset.id;
      const index = card.dataset.index;
      const total = document.querySelectorAll(".job-card").length;
      const statusEl = document.querySelector(".results-status");

      if (statusEl && index) {
        statusEl.textContent = `Result ${index} of ${total}`;
      }

      if (jobId) {
        loadJobData(jobId);
      }
    }
    return;
  }

  // 5. Custom Select Trigger
  const selectTrigger = e.target.closest(".custom-select__trigger");
  if (selectTrigger) {
    const customSelect = selectTrigger.closest(".custom-select");
    if (customSelect) {
      customSelect.classList.toggle("open");
    }
    return;
  }

  // 6. Custom Select Option
  const selectOption = e.target.closest(".custom-option");
  if (selectOption) {
    const customSelect = selectOption.closest(".custom-select");
    if (customSelect) {
      const triggerSpan = customSelect.querySelector(
        ".custom-select__trigger span"
      );
      const hiddenInput = document.getElementById("distanceInput");

      if (triggerSpan) triggerSpan.textContent = selectOption.textContent;
      if (hiddenInput) hiddenInput.value = selectOption.dataset.value;

      const options = customSelect.querySelectorAll(".custom-option");
      options.forEach((opt) => opt.classList.remove("selected"));
      selectOption.classList.add("selected");

      customSelect.classList.remove("open");
    }
    return;
  }

  // 7. Close Custom Select when clicking outside
  const openSelect = document.querySelector(".custom-select.open");
  if (openSelect && !e.target.closest(".custom-select")) {
    openSelect.classList.remove("open");
  }
};
// --- ROBUST TOUCH HANDLING END ---

const clearFiltersHandler = () => {
  const inputs = document.querySelectorAll(".filter-input");
  inputs.forEach((input) => {
    if (input.type === "checkbox") input.checked = false;
    if (input.type === "range") {
      if (input.name === "distance") input.value = 25;
      if (input.name === "salaryMin") input.value = 20000;
      if (input.name === "salaryMax") input.value = 150000;
      input.dispatchEvent(new Event("input"));
    }
  });

  // Reset Toggles
  const distanceToggle = document.getElementById("distanceToggle");
  const salaryToggle = document.getElementById("salaryToggle");

  if (distanceToggle) {
    distanceToggle.checked = false;
    distanceToggle.dispatchEvent(new Event("change"));
  }

  if (salaryToggle) {
    salaryToggle.checked = false;
    salaryToggle.dispatchEvent(new Event("change"));
  }

  handleSearch();
  if (filtersModal) filtersModal.classList.remove("filters--open");
};

if (clearFiltersBtn) {
  clearFiltersBtn.addEventListener("click", clearFiltersHandler);
}

if (clearFiltersBtnMobile) {
  clearFiltersBtnMobile.addEventListener("click", clearFiltersHandler);
}

